import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createStackNavigator } from "@react-navigation/stack";
import Icon from "react-native-vector-icons/MaterialCommunityIcons";
import SettingsScreen from "../../features/Settings/screens/settings.screen";
import MyProfileScreen from "../../features/myprofile/screens/myprofile.screen";
import AddProfilePicture from "../../features/add-profile-picture/screens/add-profile-picture.screen";
import CompleteProfile from "../../features/complete-profile/screens/complete-profile.screen";
import WorkerProfile from "../../features/worker-profile/screens/worker-profile.screen"
import DashboardScreen from "../../features/homepage/screens/Dashboard.screen";

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();

export const AppNavigator = () => (
    <Stack.Navigator
      screenOptions={{
        headerShown: true,
      }}
    >
      <Stack.Screen
        options={{ headerShown: false }}
        name="Main"
        component={TabNavigator}
      />
      <Stack.Screen name="WorkerProfile" component={WorkerProfile} />
      <Stack.Screen name="MyProfile" component={MyProfileScreen} />
      <Stack.Screen name="AddProfilePicture" component={AddProfilePicture} />
      <Stack.Screen name="CompleteProfile" component={CompleteProfile} />
    </Stack.Navigator>
  );


const TabNavigator = () => (
  <Tab.Navigator
    screenOptions={{
      headerShown: false,
    }}
  >
    <Tab.Screen
      name="Dashboard"
      component={DashboardScreen}
      options={{
        tabBarIcon: ({ color, size }) => (
          <Icon name="home" color={color} size={size} />
        ),
      }}
    />

    <Tab.Screen
      name="Settings"
      component={SettingsScreen}
      options={{
        tabBarIcon: ({ color, size }) => (
          <Icon name="cog" color={color} size={size} />
        ),
      }}
    />
  </Tab.Navigator>
);
